// Base template view.
import { EmptyState, Layout, Page } from '@shopify/polaris';
import React from 'react';
import logo from '../images/logo.png';
const img = 'https://cdn.shopify.com/s/files/1/0757/9955/files/empty-state.svg';

const Index = () => (
    <Page>
        <Layout>
            <EmptyState
                heading="Westmount Solutions Custom App"
                action={{
                    content: 'Visit westmountsolutions.com',
                    onAction: () => window.location.href='https://westmountsolutions.com/',
                }}
                image={logo}
            >
                <p>Main template.</p>
            </EmptyState>
        </Layout>
    </Page>
);

// Export this view.
export default Index;
